import React from "react";
import styled from "styled-components";

const Main = () => {
  return (
    <React.Fragment>
      <DIV>
        <P>
          <h1>당신 근처의</h1>
          <br></br>
          <h1>당근마켓</h1>
        </P>
      </DIV>
    </React.Fragment>
  );
};

export default Main;

const DIV = styled.div`
  width: 1024px;
  height: 760px;
  margin: 0 auto;
  position: relative;
  background-color: #fbf7f2;
`;

const P = styled.div`
  font-size: 2rem;
  line-height: 1.3;
  padding-top: 27rem;
  margin-bottom: 3.2rem;
  letter-spacing: -0.4px;
`;
